import React from "react";

const Rank = ({user}) => {
    return (
        <div className="flex flex-wrap justify-center hot-pink">
            <p className="f5 w-100 tc">
                {`Hai ${user.name}, Your current submit is: `}
            </p>
            <p className="f1 mv0 w-100 tc">
                { user.entries }
            </p>
        </div>
    )
}

export default Rank
